package OJ.LeetCode.Num151_200;

import java.util.ArrayList;
import java.util.HashSet;
import java.util.List;
import java.util.Set;

public class Num187RepeatedDNASequences {
    public List<String> findRepeatedDnaSequences(String s) {
        Set<String> seen = new HashSet<String>();
        Set<String> repeated = new HashSet<String>();
        if (s == null || s.length()<10)
            return new ArrayList<String>();
        for (int i = 0; i+10 <= s.length() ; i++) {
            String tmp = s.substring(i,i+10);
            if (seen.contains(tmp)){
                repeated.add(tmp);
            }else {
                seen.add(tmp);
            }
        }
        return new ArrayList<String>(repeated);
    }

    public static void main(String[] args){
        Num187RepeatedDNASequences obj = new Num187RepeatedDNASequences();
        System.out.println(obj.findRepeatedDnaSequences(""));
    }

}